file = new FileReader("C:\\Users\\Thiaga\\Documents\\Soap\\calculator.csv")
fileread = new BufferedReader(file)

//read first line
readData = fileread.readLine()

while(readData!=null)
{
	log.info readData
	String[] propData = readData.split(',')
	log.info propData[0]
	log.info propData[1]

	//Send the data to teststep
	context.setProperty("intA",propData[0])
	context.setProperty("intB",propData[1])
	//Run the test
	stepRef = testRunner.testCase.testSteps["CheckValues"]
	result = stepRef.run(testRunner,context)
	log.info result.status

	//Iterate to next set of value
	readData = fileread.readLine()
}

